  `data` text,
  `invoice_id` int(10) DEFAULT NULL,
  `station_id` int(10) DEFAULT NULL,
  `remarks` varchar(500) DEFAULT NULL,
  `lot_number` int(10) DEFAULT '0',
  `clinician_id` int(10) DEFAULT NULL,
  `packaging` int(11) NOT NULL DEFAULT '1',
  `remarks2` varchar(500) DEFAULT NULL,
  `instructions` varchar(500) DEFAULT NULL,
  `confirm_date` varchar(45) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `transaction_patient` (`patient_id`),
